import React from "react";
import SocialItem from "./SociallItem";
import ".../img"


function Social(){
    return(
    
      <ul className="list-group">
            <SocialItem 
                media = 'Facebook' 
                id='facebook'
                img='198'
            />
            <SocialItem 
                media = 'Youtube' 
                id='youtube' 
            />
            <SocialItem 
                media = 'Instagram'  
                id='instagram'
            />
      </ul>
);
}
export default Social
